import ProgressBar from 'react-bootstrap/ProgressBar';
import React from 'react'

const ProgressBarNow = () => {
  const now = 60;
  return (
    <div>
       <ProgressBar animated now={now} />
    </div>
  )
}

export default ProgressBarNow
